A.4.3.2-1/128.description:
Indicates whether the UE supports aperiodic CSI-RS for tracking for fast SCell activation, i.e.,
1) Aperiodic CSI-RS for tracking for fast SCell activation is triggered by enhanced SCell activation/deactivation MAC CE;
2) Aperiodic CSI-RS for tracking for fast SCell activation is triggered within the BWP indicated by firstActiveDownlinkBWP-Id for the SCell.
